import { motion } from 'framer-motion'

const PageVariants = {
  in: {
      opacity: 1,
      x: 0
  },
  out: {
      opacity: 0,
      x: "100%"
  }
};

const PageTransition = {
  type: "tween",
  ease: "circInOut",
  duration: 1
}

export default function Contact() {
    return (
      <motion.div id="contact-content" className="content">
        CONTACT
    </motion.div> 
  )
}
